const block1 = (context, tags, suffix) => html`<${scopeTag("ui5-icon", tags, suffix)} name="${ifDefined(context.icon)}"></${scopeTag("ui5-icon", tags, suffix)}>`;
const block2 = (context, tags, suffix) => html` (${ifDefined(context.additionalText)}) `;


export default block0;
